import React from "react";
import "../css/nastani.css";
import CardCodeworks from "./CardCodewoks";
const Nastani = () => {
  return (
    <div className="nastani">
      <h1 className="text-center">Настани</h1>
      <div>
        <CardCodeworks />
        <CardCodeworks />
        <CardCodeworks />
      </div>
    </div>
  );
};

export default Nastani;
